import ExpenseItem from './componenets/ExpenseItem'
function App() {
  const expense = [
    {
    title: 'Toilet Paper',
    amount: 94.12,
    date: new Date(2020, 7,14),
    },

    {
      title: 'Car Insurance',
      amount: 294.12,
      date: new Date(2020, 7,14),
      },

    {
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2020, 7,14),
      },

    {
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2020, 7,14),
      }


  ];
  return (
    <div>
      <h2>Let's get started</h2>
      <ExpenseItem title={expense[0].title} amount={expense[0].amount} date={expense[0].expense}></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
